// LoginCadastro.jsx
import React from "react";
import "./style.css";
import login from "./assets/login.png"; // ajuste o caminho conforme a sua pasta
import icon from "./assets/icon.png";


export const LoginCadastro = () => {

    const [isLogin, setIsLogin] =
    useState(true);

    const handleSubmit = (evento) =>{
        evento.preventDefault();
        const nome = dados.get('nome');
        const email = dados.get('email');
        const senha = dados.get('senha');
    if (modoLogin){
        return (
            <div className="login">
                <div className="conteudo">
                    {/* Lado esquerdo */}
                    <div className="lado-esquerdo">
                        <img src={login} alt="LoginCadastro" style={{ width: "100vh" }} />
                    </div>

                    {/* Lado direito */}
                    <div className="lado-direito">
                        <img src={icon} alt="LoginCadastro" style={{ width: "65px" }}/>
                        <div className="formulario">
                            <div className="campo">
                                <div className="rotulo">Email</div>
                                <div className="entrada">
                                    <div className="valor">e-mail</div>
                                </div>
                            </div>

                            <div className="campo">
                                <div className="rotulo">Senha</div>
                                <div className="entrada">
                                    <div className="valor">senha</div>
                                </div>
                            </div>

                            <div className="link-cadastro">
                                <div className="descricao">Esqueceu a senha ?</div>
                            </div>

                            <div className="grupo-botao">
                                <button className="botao">
                                    <span className="texto-botao">Acessar</span>
                                </button>
                            </div>
                        </div>

                        <div  className="texto-recuperar">Cadastre-se</div>
                    </div>
                </div>
            </div>
        );
    }else {
        return (
            <div className="Login">
                <div className="conteudo">
                    {/* Lado esquerdo */}
                    <div className="lado-esquerdo">
                        <img src={login} alt="LoginCadastro" style={{ width: "100vh" }} />
                    </div>

                    {/* Lado direito */}
                    <div className="lado-direito">
                        <img src={icon} alt="LoginCadastro" style={{ width: "65px" }}/>
                        <div className="formulario">
                            <div className="campo">
                                <div className="rotulo">Email</div>
                                <div className="entrada">
                                    <div className="valor">e-mail</div>
                                </div>

                                <div className="rotulo">Cpf</div>
                                <div className="entrada">
                                    <div className="valor">Cpf</div>
                                </div>
                            </div>

                            <div className="campo">
                                <div className="rotulo">Senha</div>
                                <div className="entrada">
                                    <div className="valor">senha</div>
                                </div>
                            </div>

                            <div className="link-cadastro">
                                <div className="descricao">Esqueceu a senha ?</div>
                            </div>

                            <div className="grupo-botao">
                                <button className="botao">
                                    <span className="texto-botao">Acessar</span>
                                </button>
                            </div>
                        </div>

                        <div  className="texto-recuperar">Cadastre-se</div>
                    </div>
                </div>
            </div>
        );
    }
}
};
